PROBLEM TYPE:
  PROBLEMTYPE: "Structure"
IO:
  VERBOSITY: "standard"
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 1
IO/RUNTIME VTK OUTPUT/BEAMS:
  OUTPUT_BEAMS: true
  DISPLACEMENT: true
  ELEMENT_GID: true
STRUCTURAL DYNAMIC:
  LINEAR_SOLVER: 1
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "Statics"
  LOADLIN: false
  NLNSOL: "fullnewton"
  PREDICT: "ConstDis"
  TIMESTEP: 0.5
  NUMSTEP: 2
  MAXTIME: 1.0
  TOLRES: 1e-6
